/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */
import { Playground, Props } from "docz";
import Table from "../src/index";
import LazyLoad from "./lazyLoad";

const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "table"
    }}>{`Table`}</h1>
    <h2 {...{
      "id": "properties"
    }}>{`Properties`}</h2>
    <Props of={Table} mdxType="Props" />
    <h2 {...{
      "id": "usage"
    }}>{`Usage`}</h2>
    <Playground __position={1} __code={'<Table\n  rowKey=\"key\"\n  columns={[\n    {\n      title: \'Key\',\n      dataIndex: \'key\',\n      width: 200,\n    },\n    {\n      title: \'Name\',\n      dataIndex: \'__depth\',\n      width: 200,\n    },\n    {\n      title: \'Age\',\n      dataIndex: \'age\',\n      width: 200,\n    },\n    {\n      title: \'Address\',\n      children: [\n        {\n          title: \'公司地址\',\n          dataIndex: \'address1\',\n          width: 200,\n        },\n        {\n          title: \'家庭地址\',\n          dataIndex: \'address2\',\n          width: 200,\n          children: [\n            {\n              title: \'家庭地址1\',\n              dataIndex: \'address3\',\n              width: 200,\n            },\n            {\n              title: \'家庭地址2\',\n              dataIndex: \'address4\',\n              width: 200,\n            },\n          ],\n        },\n      ],\n    },\n  ]}\n  dataSource={(() => {\n    let data = []\n    for (let i = 0; i < 4; i++) {\n      data.push({\n        key: i,\n        name: `Edward King ${i}`,\n        age: 32,\n        address1: `London, Park Lane no. ${i}`,\n        address2: `London, Park Lane no. ${i}`,\n        address3: `London, Park Lane no. ${i}`,\n        address4: `London, Park Lane no. ${i}`,\n        children: [\n          {\n            key: i + \'-\' + 1,\n            name: `Edward King ${i}`,\n            age: 32,\n            address1: `London, Park Lane no. ${i}`,\n            address2: `London, Park Lane no. ${i}`,\n            address3: `London, Park Lane no. ${i}`,\n            address4: `London, Park Lane no. ${i}`,\n          },\n          {\n            key: i + \'-\' + 2,\n            name: `Edward King ${i}`,\n            age: 32,\n            address1: `London, Park Lane no. ${i}`,\n            address2: `London, Park Lane no. ${i}`,\n            address3: `London, Park Lane no. ${i}`,\n            address4: `London, Park Lane no. ${i}`,\n            children: [\n              {\n                key: i + \'-2-\' + 1,\n                name: `Edward King ${i}`,\n                age: 32,\n                address1: `London, Park Lane no. ${i}`,\n                address2: `London, Park Lane no. ${i}`,\n                address3: `London, Park Lane no. ${i}`,\n                address4: `London, Park Lane no. ${i}`,\n                children: [\n                  {\n                    key: i + \'-2-1-\' + 1,\n                    name: `Edward King ${i}`,\n                    age: 32,\n                    address1: `London, Park Lane no. ${i}`,\n                    address2: `London, Park Lane no. ${i}`,\n                    address3: `London, Park Lane no. ${i}`,\n                    address4: `London, Park Lane no. ${i}`,\n                  },\n                  {\n                    key: i + \'-2-1-\' + 2,\n                    name: `Edward King ${i}`,\n                    age: 32,\n                    address1: `London, Park Lane no. ${i}`,\n                    address2: `London, Park Lane no. ${i}`,\n                    address3: `London, Park Lane no. ${i}`,\n                    address4: `London, Park Lane no. ${i}`,\n                  },\n                ],\n              },\n              {\n                key: i + \'-2-\' + 2,\n                name: `Edward King ${i}`,\n                age: 32,\n                address1: `London, Park Lane no. ${i}`,\n                address2: `London, Park Lane no. ${i}`,\n                address3: `London, Park Lane no. ${i}`,\n                address4: `London, Park Lane no. ${i}`,\n              },\n            ],\n          },\n          {\n            key: i + \'-\' + 3,\n            name: `Edward King ${i}`,\n            age: 32,\n            address1: `London, Park Lane no. ${i}`,\n            address2: `London, Park Lane no. ${i}`,\n            address3: `London, Park Lane no. ${i}`,\n            address4: `London, Park Lane no. ${i}`,\n          },\n        ],\n      })\n    }\n    return data\n  })()}\n/>'} __scope={{
      props: this ? this.props : props,
      Playground,
      Props,
      Table,
      LazyLoad
    }} __codesandbox={`undefined`} style={{
      height: 600
    }} mdxType="Playground">
  <Table rowKey="key" columns={[{
        title: "Key",
        dataIndex: "key",
        width: 200
      }, {
        title: "Name",
        dataIndex: "__depth",
        width: 200
      }, {
        title: "Age",
        dataIndex: "age",
        width: 200
      }, {
        title: "Address",
        children: [{
          title: "公司地址",
          dataIndex: "address1",
          width: 200
        }, {
          title: "家庭地址",
          dataIndex: "address2",
          width: 200,
          children: [{
            title: "家庭地址1",
            dataIndex: "address3",
            width: 200
          }, {
            title: "家庭地址2",
            dataIndex: "address4",
            width: 200
          }]
        }]
      }]} dataSource={(() => {
        let data = [];

        for (let i = 0; i < 4; i++) {
          data.push({
            key: i,
            name: `Edward King ${i}`,
            age: 32,
            address1: `London, Park Lane no. ${i}`,
            address2: `London, Park Lane no. ${i}`,
            address3: `London, Park Lane no. ${i}`,
            address4: `London, Park Lane no. ${i}`,
            children: [{
              key: i + "-" + 1,
              name: `Edward King ${i}`,
              age: 32,
              address1: `London, Park Lane no. ${i}`,
              address2: `London, Park Lane no. ${i}`,
              address3: `London, Park Lane no. ${i}`,
              address4: `London, Park Lane no. ${i}`
            }, {
              key: i + "-" + 2,
              name: `Edward King ${i}`,
              age: 32,
              address1: `London, Park Lane no. ${i}`,
              address2: `London, Park Lane no. ${i}`,
              address3: `London, Park Lane no. ${i}`,
              address4: `London, Park Lane no. ${i}`,
              children: [{
                key: i + "-2-" + 1,
                name: `Edward King ${i}`,
                age: 32,
                address1: `London, Park Lane no. ${i}`,
                address2: `London, Park Lane no. ${i}`,
                address3: `London, Park Lane no. ${i}`,
                address4: `London, Park Lane no. ${i}`,
                children: [{
                  key: i + "-2-1-" + 1,
                  name: `Edward King ${i}`,
                  age: 32,
                  address1: `London, Park Lane no. ${i}`,
                  address2: `London, Park Lane no. ${i}`,
                  address3: `London, Park Lane no. ${i}`,
                  address4: `London, Park Lane no. ${i}`
                }, {
                  key: i + "-2-1-" + 2,
                  name: `Edward King ${i}`,
                  age: 32,
                  address1: `London, Park Lane no. ${i}`,
                  address2: `London, Park Lane no. ${i}`,
                  address3: `London, Park Lane no. ${i}`,
                  address4: `London, Park Lane no. ${i}`
                }]
              }, {
                key: i + "-2-" + 2,
                name: `Edward King ${i}`,
                age: 32,
                address1: `London, Park Lane no. ${i}`,
                address2: `London, Park Lane no. ${i}`,
                address3: `London, Park Lane no. ${i}`,
                address4: `London, Park Lane no. ${i}`
              }]
            }, {
              key: i + "-" + 3,
              name: `Edward King ${i}`,
              age: 32,
              address1: `London, Park Lane no. ${i}`,
              address2: `London, Park Lane no. ${i}`,
              address3: `London, Park Lane no. ${i}`,
              address4: `London, Park Lane no. ${i}`
            }]
          });
        }

        return data;
      })()} mdxType="Table" />
    </Playground>
    <h2 {...{
      "id": "lazy-load"
    }}>{`Lazy load`}</h2>
    <Playground __position={2} __code={'<LazyLoad />'} __scope={{
      props: this ? this.props : props,
      Playground,
      Props,
      Table,
      LazyLoad
    }} __codesandbox={`undefined`} style={{
      height: 600
    }} mdxType="Playground">
  <LazyLoad mdxType="LazyLoad" />
    </Playground>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
